public class InnerEndpointConfigAsyncInferenceConfigFactory(Action<Humidifier.SageMaker.EndpointConfigTypes.AsyncInferenceConfig> factoryAction = null) : SubResourceFactory<Humidifier.SageMaker.EndpointConfigTypes.AsyncInferenceConfig>
{

    internal InnerEndpointConfigAsyncInferenceOutputConfigFactory OutputConfigFactory { get; set; }

    internal InnerEndpointConfigAsyncInferenceClientConfigFactory ClientConfigFactory { get; set; }

    protected override Humidifier.SageMaker.EndpointConfigTypes.AsyncInferenceConfig Create()
    {
        var asyncInferenceConfigResult = CreateAsyncInferenceConfig();
        factoryAction?.Invoke(asyncInferenceConfigResult);

        return asyncInferenceConfigResult;
    }

    private Humidifier.SageMaker.EndpointConfigTypes.AsyncInferenceConfig CreateAsyncInferenceConfig()
    {
        var asyncInferenceConfigResult = new Humidifier.SageMaker.EndpointConfigTypes.AsyncInferenceConfig();

        return asyncInferenceConfigResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.EndpointConfigTypes.AsyncInferenceConfig result)
    {
        base.CreateChildren(result);

        result.OutputConfig ??= OutputConfigFactory?.Build();
        result.ClientConfig ??= ClientConfigFactory?.Build();
    }

} // End Of Class

